import React, { useState } from 'react';

import Login from './components/Login/Login';


function App() {

  const [isLogin, setIsLogin] = useState(false);
  const LoginHandler = (props) => {
    setIsLogin(true);
  }

  return (
    <React.Fragment>
      {!isLogin && <Login onLogin={LoginHandler}></Login>}
      {isLogin && <p>logined</p>}
    </React.Fragment>
  );
}

export default App;
